export default function getLasData(data) {
  let profileList = [];

  data['data'].forEach(profile => {
    profileList.push([
      {
        type: "las",
        index: "Device",
        data: (() => {
          try {
            let destruct = profile['mac'];
            return destruct ? destruct : "";
          }
          catch {return ""};
        })()
      },
      {
        index: "User",
        data: (() => {
          try {
            let destruct = profile['user']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Extension",
        data: (() => {
          try {
            let destruct = profile['line']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Location",
        data: "LAS"
      }
    ])
  })

  return new Promise((resolve, reject) => {
    resolve(profileList)
    reject("Unable to retrieve voicemails.")
  })
}
